CREATE TABLE client (
  `id` mediumint(8) unsigned NOT NULL auto_increment, 
  `clientId` MEDIUMINT default NULL,
  `firstName` varchar(255) default NULL,
  `lastName` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  `homePhone` varchar(100) default NULL,
  `workPhone` varchar(100) default NULL,
  `street` varchar(255) default NULL,
  `houseNumber` varchar(50) default NULL,
  `city` varchar(50) default NULL,
  `country` varchar(50) default NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Column privileges';



CREATE TABLE houses (
  `id` mediumint(8) unsigned NOT NULL auto_increment, 
  `houseId` MEDIUMINT default NULL,
  `street` varchar(255) default NULL,
  `houseNumber` varchar(50) default NULL,
  `zipCode` varchar(50) default NULL,
  `city` varchar(50) default NULL,
  `description` TEXT default NULL,
  `attribute1` varchar(50) default NULL,
  `attribute2` varchar(50) default NULL,
  `attribute3` varchar(50) default NULL,
  `attribute4` varchar(50) default NULL,
  `attribute5` varchar(50) default NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='Column privileges';

